package Object;

public class DVD extends Media{

	private String daoDienString;
	private float ThoiLuong;
	private String theLoaiString;
	private String studioString;
	private String ngonNguString;
	private String phudeString;
	public DVD() {
		// TODO Auto-generated constructor stub
	}
	public float getThoiLuong() {
		return ThoiLuong;
	}
	public void setThoiLuong(float thoiLuong) {
		ThoiLuong = thoiLuong;
	}
	public String getTheLoaiString() {
		return theLoaiString;
	}
	public void setTheLoaiString(String theLoaiString) {
		this.theLoaiString = theLoaiString;
	}
	public String getStudioString() {
		return studioString;
	}
	public void setStudioString(String studioString) {
		this.studioString = studioString;
	}
	public String getNgonNguString() {
		return ngonNguString;
	}
	public void setNgonNguString(String ngonNguString) {
		this.ngonNguString = ngonNguString;
	}
	public String getPhudeString() {
		return phudeString;
	}
	public void setPhudeString(String phudeString) {
		this.phudeString = phudeString;
	}
	public String getDaoDienString() {
		return daoDienString;
	}
	public void setDaoDienString(String daoDienString) {
		this.daoDienString = daoDienString;
	}
	
}
